import {
  FaHome,
  FaUsers,
  FaStoreAlt,
  FaArchive,
  FaRegSun,
  FaSignOutAlt 
} from "react-icons/fa";
import { NavLink } from "react-router-dom";
import logoAdmin from "@assets/images/logo-admin.png"

const ListNav: { id: number; icon: any; to: string; title: string }[] = [
  {
    id: 1,
    icon: <FaHome />,
    to: "/admin/dashboard",
    title: "Dashboard",
  },
  {
    id: 2,
    icon: <FaUsers />,
    to: "/admin/users",
    title: "Customer",
  },
  {
    id: 3,
    icon: <FaStoreAlt />,
    to: "/admin/shop",
    title: "Shop",
  },
  {
    id: 4,
    icon: <FaArchive />,
    to: "/admin/category",
    title: "Category",
  },
  {
    id: 5,
    icon: <FaRegSun />,
    to: "/admin/setting",
    title: "Setting",
  },
  {
    id: 5,
    icon: <FaSignOutAlt />,
    to: "/admin/login",
    title: "Log Out",
  }
];

const Navbar = () => {
  return (
    <>
      <div className="navbar w-[15%] h-[100vh] bg-[#394449] shadow-2xl absolute z-50">
        <div className="logo">
          <img src={logoAdmin} alt="" />
        </div>
        {ListNav.map(
          (
            item: { id: number; icon: any; to: string; title: string },
            index: number
          ) => (
            <NavLink
              to={item.to}
              key={item.id}
              className="flex p-5 gap-x-10 items-center"
            >
              <div className="items-center text-[40px]">{item.icon}</div>
              <div className="text-[20px]">{item.title}</div>
            </NavLink>
          )
        )}
      </div>
    </>
  );
};

export default Navbar;
